// export default AdminLayout

import React, { useEffect, useState } from 'react'
import { Outlet, Link, useNavigate } from 'react-router-dom'

const AdminLayout = () => {
  const navigate = useNavigate();
  const [item, setItem] = useState({});
  const [photo, setPhoto] = useState("");
  const defaultPhoto = "https://cdn.pixabay.com/photo/2020/07/01/12/58/icon-5359553_640.png";

  useEffect(() => {
    const storedEmail = localStorage.getItem("Email");
    const storedPhoto = localStorage.getItem("Photo");

    if (!storedEmail) {
      navigate("/login");
    } else {
      setItem({ Email: storedEmail });
      fetchUserPhoto(storedEmail);
    }
  }, []);

  const fetchUserPhoto = async (email) => {
    try {
      const response = await fetch("http://localhost:5000/api/getUser", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ Email: email }),
      });

      const data = await response.json();
      if (response.ok) {
        setPhoto(data.Photo || defaultPhoto);
        localStorage.setItem("Photo", data.Photo || defaultPhoto);
      } else {
        console.error("User not found");
      }
    } catch (error) {
      console.error("Error fetching user photo:", error);
    }
  };

  const handleSignOut = () => {
    localStorage.clear();
    navigate("/blog");
  }

  return (
    <div>
      <div className="container-fluid">
        <div className="row flex-nowrap">
          <div
            className="col-12 col-md-3 col-xl-2 px-3 bg-dark"
            style={{ minHeight: "100vh" }}
          >
            <div
              className="d-flex flex-column align-items-start px-3 pt-2 text-white"
              style={{ minHeight: '100vh' }}
            >
              <a href="/" className="d-flex align-items-center pb-3 mb-md-0 me-md-auto text-white text-decoration-none">
                <span className="fs-5 d-inline">Menu</span>
              </a>
              <ul className="nav nav-pills flex-column mb-sm-auto mb-0 align-items-start" id="menu">
                <li className="nav-item">
                  <Link to="/admin/Enquiry" className="nav-link align-middle px-0 text-white">
                    <i className="fs-4 bi-house"></i> <span className="ms-2">Home</span>
                  </Link>
                </li>
                <li>
                  <div className="dropdown pb-2">
                    <a href="#" className="nav-link px-0 align-middle dropdown-toggle text-white" data-bs-toggle="dropdown">
                      <i className="fs-4 bi-people"></i> <span className="ms-2">Dashboard</span>
                    </a>
                    <ul className="dropdown-menu dropdown-menu-dark text-small shadow">
                      <li><Link className="dropdown-item" to="/admin/viewcategory">Categories Dashboard</Link></li>
                      <li><Link className="dropdown-item" to="/admin/viewsubcategory">Sub-Categories Dashboard</Link></li>
                      <li><Link className="dropdown-item" to="/admin/viewsmallsubcategory">Small-Sub-Categories Dashboard</Link></li>
                      <li><Link className="dropdown-item" to="/admin/vieworders">Order Dashboard</Link></li>
                    </ul>
                  </div>
                </li>
                <li>
                  <div className="dropdown pb-2">
                    <a href="#" className="nav-link px-0 align-middle dropdown-toggle text-white" data-bs-toggle="dropdown">
                      <i className="fs-4 bi-journal"></i> <span className="ms-2">Blogs</span>
                    </a>
                    <ul className="dropdown-menu dropdown-menu-dark text-small shadow">
                      <li><Link className="dropdown-item" to="/admindashboard/addBlogs">Add Blogs</Link></li>
                      <li><Link className="dropdown-item" to="/admin/viewBlogs">View Blogs</Link></li>
                    </ul>
                  </div>
                </li>
                <li>
                  <a href="#submenu3" data-bs-toggle="collapse" className="nav-link px-0 align-middle text-white">
                    <i className="fs-4 bi-grid"></i> <span className="ms-2">Products</span>
                  </a>
                  <ul className="collapse nav flex-column ms-1" id="submenu3" data-bs-parent="#menu">
                    <li className="w-100">
                      <a href="#" className="nav-link px-0 text-white"> <span className="d-inline">Product 1</span></a>
                    </li>
                    <li>
                      <a href="#" className="nav-link px-0 text-white"> <span className="d-inline">Product 2</span></a>
                    </li>
                    <li>
                      <a href="#" className="nav-link px-0 text-white"> <span className="d-inline">Product 3</span></a>
                    </li>
                    <li>
                      <a href="#" className="nav-link px-0 text-white"> <span className="d-inline">Product 4</span></a>
                    </li>
                  </ul>
                </li>
                <li>
                  <Link to="/admin/getordersinadmin" className="nav-link px-0 align-middle text-white">
                    <i className="fs-4 bi-bag"></i> <span className="ms-2">Customer Orders</span>
                  </Link>
                </li>
                <li>
                  <div className="dropdown pb-2">
                    <a href="#" className="nav-link px-0 align-middle dropdown-toggle text-white" data-bs-toggle="dropdown">
                      <i className="fs-4 bi-folder"></i> <span className="ms-2">Categories</span>
                    </a>
                    <ul className="dropdown-menu dropdown-menu-dark text-small shadow">
                      <li><Link className="dropdown-item" to="/admin/addcategories">Categories</Link></li>
                      <li><Link className="dropdown-item" to="/admin/addsubcategories">Sub-Categories</Link></li>
                      <li><Link className="dropdown-item" to="/admin/addsmallsubcategories">Small-Sub-Categories</Link></li>
                    </ul>
                  </div>
                </li>
              </ul>
              <hr />
              <div className="dropdown pb-4">
                <a href="#" className="d-flex align-items-center text-white text-decoration-none dropdown-toggle" data-bs-toggle="dropdown">
                  <img src={photo || defaultPhoto} alt="admin" width="30" height="30" className="rounded-circle" />
                  <span className="ms-2">{item.Email}</span>
                </a>
                <ul className="dropdown-menu dropdown-menu-dark text-small shadow">
                  <li><a className="dropdown-item" href="#">New project...</a></li>
                  <li><a className="dropdown-item" href="#">Settings</a></li>
                  <li><Link className="dropdown-item" to="/admin/profile">Profile</Link></li>
                  <li><hr className="dropdown-divider" /></li>
                  <li><a className="dropdown-item" href="#" onClick={handleSignOut}>Sign out</a></li>
                </ul>
              </div>
            </div>
          </div>

          {/* Outlet for content pages */}
          <Outlet />
        </div>
      </div>
    </div>
  );
}

export default AdminLayout;
